import React, { Component } from "react";
import "./App.css";

function App() {
  return (
    <div className="app-wrapper">
      <header className="header">
        <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pngwing.com%2Fen%2Fsearch%3Fq%3Dm%2BLetter&psig=AOvVaw1lkM00OMFSetR7kE8hRgf1&ust=1705831875566000&source=images&cd=vfe&opi=89978449&ved=0CBMQjRxqFwoTCIjG2Yzd64MDFQAAAAAdAAAAABAF" />
      </header>
      <nav className="nav">
        <div>Profile</div>
        <div>Messages</div>
      </nav>
      <div className="content">Main Content</div>
    </div>
  );
}

export default App;
